INSERT INTO `field_data_body` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`) VALUES
('node', 'page', 0, 1, 1, 'und', 0, 'Hi we are Coffee House! We serve safe drinking coffee for the tired masses.\r\n\r\nJava, shop percolator extra sugar ut sit rich instant percolator rich cultivar extra. Filter at, wings crema foam, java, mazagran qui java, skinny, affogato trifecta sugar saucer spoon medium decaffeinated turkish. Macchiato est, extra, caramelization, caffeine, robusta strong, half and half est body as roast foam. Est black aged, single origin galão siphon cup ut, whipped, roast plunger pot mazagran, percolator, galão frappuccino coffee brewed irish robusta. Java, pumpkin spice affogato, cinnamon decaffeinated instant filter café au lait a single shot extra siphon foam extra variety affogato milk. Caramelization kopi-luwak aroma french press, trifecta viennese dark fair trade, arabica wings beans milk, café au lait mocha, kopi-luwak, caramelization, pumpkin spice cup so at beans grinder filter sugar.\r\n\r\nFilter french press affogato sugar, so siphon, aged caffeine foam percolator et bar single origin. Organic, as aroma café au lait, mocha espresso french press irish robusta to go turkish caramelization id est café au lait. Aromatic single shot robusta cortado grounds ut sit a, blue mountain flavour acerbic eu, cream cultivar filter plunger pot, strong at café au lait sit mazagran lungo. Cappuccino, and single shot aroma, turkish et, spoon single origin coffee, roast ut steamed at single shot cappuccino grounds. Extraction, white ut whipped espresso, as bar cortado acerbic, strong, extra turkish, strong doppio white, pumpkin spice lungo breve foam grounds. Extraction, strong, aftertaste coffee shop flavour robusta, as, cultivar café au lait whipped steamed americano macchiato.', '', 'filtered_html'),
('node', 'page', 0, 2, 2, 'und', 0, 'Don''t Sue Us!', '', 'filtered_html'),
('node', 'article', 0, 3, 3, 'und', 0, 'Java, shop percolator extra sugar ut sit rich instant percolator rich cultivar extra. Filter at, wings crema foam, java, mazagran qui java, skinny, affogato trifecta sugar saucer spoon medium decaffeinated turkish. Macchiato est, extra, caramelization, caffeine, robusta strong, half and half est body as roast foam. Est black aged, single origin galão siphon cup ut, whipped, roast plunger pot mazagran, percolator, galão frappuccino coffee brewed irish robusta. Java, pumpkin spice affogato, cinnamon decaffeinated instant filter café au lait a single shot extra siphon foam extra variety affogato milk. Caramelization kopi-luwak aroma french press, trifecta viennese dark fair trade, arabica wings beans milk, café au lait mocha, kopi-luwak, caramelization, pumpkin spice cup so at beans grinder filter sugar.\r\n\r\nFilter french press affogato sugar, so siphon, aged caffeine foam percolator et bar single origin. Organic, as aroma café au lait, mocha espresso french press irish robusta to go turkish caramelization id est café au lait. Aromatic single shot robusta cortado grounds ut sit a, blue mountain flavour acerbic eu, cream cultivar filter plunger pot, strong at café au lait sit mazagran lungo. Cappuccino, and single shot aroma, turkish et, spoon single origin coffee, roast ut steamed at single shot cappuccino grounds. Extraction, white ut whipped espresso, as bar cortado acerbic, strong, extra turkish, strong doppio white, pumpkin spice lungo breve foam grounds. Extraction, strong, aftertaste coffee shop flavour robusta, as, cultivar café au lait whipped steamed americano macchiato.', '', 'filtered_html'),
('node', 'article', 0, 4, 4, 'und', 0, 'Luwak Coffee\r\n\r\nTry Luwak coffee that includes part-digested coffee cherries eaten and defecated by the Asian palm civet!\r\n\r\nI swear its an unforgettable experience!\r\n\r\n\r\n', '', 'filtered_html'),
('node', 'page', 0, 5, 5, 'und', 0, 'We are hiring!\r\n\r\nJob posting for: PHP/Drupal Jr. Developer\r\n\r\nWe are looking for someone to personally serve coffee to the more important people in the company.\r\n\r\n- Need to have attended Epicodus\r\n- Must have 20 years of experience\r\n', '', 'filtered_html'),
('node', 'article', 0, 6, 6, 'und', 0, 'Come try our new exotic coffee from Indonesia!\r\n\r\nOur Address:\r\n\r\nCoffee-House\r\n123 Burnside Street\r\nPortland, Oregon 97205\r\n\r\nWe have live civets for the kids to collect and sample "freshly" made Luwak coffee!\r\n\r\n', '', 'filtered_html'),
('node', 'coffee_import', 0, 7, 7, 'und', 0, 'An exotic blend of flavors you are bound to learn from. ', '', 'filtered_html'),
('node', 'coffee_import', 0, 8, 8, 'und', 0, 'An unforgettable coffee experience from Indonesia.\r\n\r\n', '', 'filtered_html'),
('node', 'coffee_import', 0, 9, 9, 'und', 0, 'Expensive coffee from South America.', '', 'filtered_html');
